import pandas as pd 
import numpy as np

prof = pd.read_table('https://raw.githubusercontent.com/bog5d/Feng-chao/master/20%E5%B9%B4%E6%AF%9B%E5%88%A9%E8%A1%A8',header=2).fillna('/')
prof.head(5)

prof = prof[['单据日期', '单据编号' ,'客户名称', '销售价(本)', '成本价(本)','基本数量', '销售收入(本)', '销售毛利(本)', '销售毛利率']]
prof.head()

# 将含有ss字符的列，打包成一个list。 
y = list(prof.loc[prof['单据编号'].str.contains('SS-')]['单据编号'])
# 替换掉含有ss字符的列
prof['单据编号'] = prof['单据编号'].replace(y,np.nan,regex=True)

# 向前填充
prof = prof.fillna(method='pad')

# 去掉小计那些列
prof = prof.loc[~(prof['单据日期']=='/')]

# 小计金额测算出来
prof['小计金额'] = prof['销售价(本)']*prof['基本数量']
prof

#分割业务和客户
prof['业务'],prof['客户'] = prof['客户名称'].str.split('-',1).str
prof
